void LinearRegress(double *b_slope, double *a_int, double y[], double x[], int number)
{
	double sum_xy = 0, sum_y = 0;
	double sum_x = 0, sum_xx = 0;
	int i;

	for (i = 0; i < number; i++)
	{
		sum_xy += (*(x + i))  *   (*(y + i));
		sum_y += *(y + i);
		sum_x += *(x + i);
		sum_xx += (*(x + i)) * (*(x + i));
	}

	*b_slope = (sum_xy - sum_x * sum_y / number) / (sum_xx - sum_x * sum_x / number);
	*a_int = sum_y / number - (*b_slope) * sum_x / number;
}


